(2, '117.242.149.59', 'Parikshit Bera', 'bera.friends.parikshit@gmail.com', 'e7436cc85044da5719e54a56d9649669', 'How I Submit the bank chalan?', 2, 'Go to your nearest SBI Branch and Deposit in Cash.', '2013-02-21 09:27:38', '0000-00-00 00:00:00'),
