(5, '116.193.135.230', 'MONAJ KUMAR SHAW', 'monajshaw@gmail.com', '2761dbaf2a690f0d0987f00004942a62', 'my problem online application from no submited.pls help me how many from filup ', 2, '  ', '2013-02-21 11:48:40', '0000-00-00 00:00:00'),
(6, '117.226.209.76', 'UTSAB PUTATUNDA', 'utsav.putatunda@gmail.com', 'eb51ea02f7da4e6c63327e18b4da88a9', 'when the original online will we get??', 2, ' ', '2013-02-21 12:12:05', '0000-00-00 00:00:00'),
(7, '117.205.160.31', 'PRADIP PAL', 'pradip.ag253@gmail.com', '6988fbe3d1932c4bd1bb91e15ee2d055', 'I applied the post of Lower Division Clerk , but I can''t download the chalan and Application form.', 2, '  ', '2013-02-21 12:19:09', '0000-00-00 00:00:00'),
(8, '117.215.168.231', 'J.V.VINOD GOWD', 'katyayanimurali@gmail.com', '507a28396acecbf67df319df104ba85d', 'Respected Sir,\r\n\r\nIn online it is only example for all. I have applied for testing online application but i have not received any print challan please give me the details for clarification of this online.\r\n', 2, ' ', '2013-02-21 13:45:20', '0000-00-00 00:00:00'),
(9, '112.79.36.42', 'SHANTANU JANA', 'shantanu.jana03@gmail.com', '0382e9f05ee35b47b320e4ecad663870', 'I have submitted the online application form. But when I click on the ''print challan'' option, there was a blank page with a serial number. There was neither any registration number, nor any challan. Now what should I do? Should I fill up the online form again? Is there any chance of rejection of my application form if I fill up the online form again? ', 2, '  ', '2013-02-21 13:56:50', '0000-00-00 00:00:00'),
(10, '106.199.119.234', 'Arindam Dey', 'abcsmd@rediffmail.com', '713b9f774e20f3c5f4c73b7d37a33fa5', 'Not able to print the challan which comes at the very bottom. Please give me solution as quick as possible.', 2, ' ', '2013-02-21 14:06:01', '0000-00-00 00:00:00'),
(11, '115.250.142.94', 'KOUSHIK ROY', 'koushik0606@gmail.com', '26b9b401bc4fca2717d634200a8bcb53', 'what are the process of online application of district high court?', 2, ' ', '2013-02-21 15:12:46', '0000-00-00 00:00:00'),
(12, '122.160.187.150', 'Sibu Banik', 'sibu.banik@yahoo.com', '5bba4e04290602bd92929bbb848bfa51', 'Today (22.02.2013) at 11.00 I have registered my application form and have taken challan for depositing of Rs. 200 to SBI and next step I will follow the remaining formalities as I have to depost Rs. 200 to Bank and it takes some time.\r\nRegards\r\nSibu Banik\r\n(9674307606)', 1, 'Deposit the fees to bank and check your Application Status.', '2013-02-22 05:59:10', '0000-00-00 00:00:00'),
(13, '59.93.193.211', 'Milan Das Adhikary', 'adhikarymilan2012@gmail.com', '47630c8a5e6eaaecac8d8877f739a59b', 'How can I get status of my online submitted form?', 2, ' ', '2013-02-22 06:05:39', '0000-00-00 00:00:00'),
(14, '112.79.36.15', 'JAYANTA KUMAR ROY', 'jayantaroy_06@yahoo.co.in', '5a36c9c076987dfc5a9bff5940b01471', 'I have applied online for the post of LDC(GRP-C)(staff recruitment examination 2013, paschim Medinipur Judgeship)  and printed  out the bank deposit slip in which my application ID and mobile no also mentioned. But after deposit the fees what should i do. when and how  should i submit the bank deposit slip and all my testimonial and photograph to the recruitment authority. At this stage I am feeling hesitate. I can''t realize what should I do. Is it compulsory to submit documents, photograph and deposit slip for both the online and offline application, its not clear to me.  Please help me and give a proper guidance regarding the same. \r\nwaiting for your reply and guideline and obliged. \r\n\r\nthanking you. \r\n\r\nwith regards, \r\n\r\nJAYANTA KUMAR ROY\r\njayantaroy_06@yahoo.co.in\r\n', 1, 'No document required for online submission. Photograph will be required while downloading the Admin Card. Deposit Slip is required in case of bank verification failed and will be asked to submit online if required. For all details please check your Application Status.', '2013-02-22 06:38:44', '0000-00-00 00:00:00'),
(15, '117.254.255.96', 'Dipak Mahata', 'mahatadipak@gmail.com', '8c6f207ca7f17e6971dfa24083bf51c9', 'sir,\r\n\r\ni want to apply for different categories of posts,in the judgeship of paschim medinipur , through online but how could i pay my necessary fees by online , pls send me in detail\r\n\r\nthanking you \r\nyours faithfully\r\ndipak mahata', 1, 'Submit one Application for each POST and download the Bank Challans then Deposit all of them and check status of All applications individually.', '2013-02-22 07:32:29', '0000-00-00 00:00:00'),
(16, '101.210.151.172', 'Nirmal Saha', 'nsahaerda@gmail.com', '4d9cde6fcc4f7029201fe0187099b10a', 'How can I pay the fee for the post of Stenographer ?\r\nPlz help me as soon as possible through my mail address.\r\n\r\n\r\nThanking You\r\nNirmal Saha', 2, ' ', '2013-02-22 08:15:58', '0000-00-00 00:00:00'),
(17, '117.194.37.164', 'KABIRUL ISLAM', 'kabiruliijt@gmail.com', '77433ce18b2de660f1633b7b0df34d6e', 'In case of online submission whether I have to send attested document to your Office with bank orginal challan copy or not?If answer is yes when I have to submit the necessary attested & applicant''s sign document?', 2, 'In case of online submission no document is required. Option to download Admit will be available online after verification of bank deposit from bank. Application ID needs to be entered by the Bank Operator.', '2013-02-22 08:27:24', '0000-00-00 00:00:00');
